export function Collect(){
    return(
        <div className='flex flex-col mt-4'>
            <div className='flex_center'>
                개인(신용)정보의 수집, 이용에 관한 사항
            </div>
            <p>
                개인(신용)정보의 수집, 이용에 관한 사항
                당사는 「개인정보보호법」 및 「신용정보의 이용 및 보호에 관한 법률」에 따라 귀하의 개인(신용)정보를 다음과 같이 수집ㆍ이용하고자 합니다.
            </p>
        </div>
    )
}
